import Estilo from '../Hojas de Estilos/Carrucel.css'
import ItemCarrucel from "./ItemCarrucel";
function Carrucel(){
    return(
        <>
            <div className="carrucel">
               <ItemCarrucel /> 
               <ItemCarrucel /> 
               <ItemCarrucel /> 
            </div>
            
        </>
    )
}

export default Carrucel;
